import {Route, Routes} from 'react-router-dom'
import Page from './pages/User/Page';

function App() {
  return (

    <div>
      <span>aaaaaaaa</span>
      <Routes>
        <Route path = "/" element ={<Page/>}/>
      </Routes>
    </div>
  );
}

export default App;
